                result[i_n1 + i_n2] = summ % 10;
                i_n2++;
            }
            if (carry > 0) {
                result[i_n1 + i_n2] += carry;
            }
            i_n1++;
        }
        int i = result.length - 1;
        while (i >= 0 && result[i] == 0) {
            i--;
        }
        if (i == -1) {
            return "0";
        }
        StringBuilder s = new StringBuilder();
        while (i >= 0) {
            s.append((char)(result[i] + '0'));
            i--;
        }
        return s.toString();
    }
